import React, { Component } from 'react';


function CoursForm (props){
	
		return (
			<div>
				<form>
					<input type="text" onChange={props.updateCourse}/>
					<button type="submit">Add cours</button>
				</form>
				
			</div>
		);
	}

export default CoursForm;
